โหมด<size:3>{
}<size:40>{
<b>{หน้าต่าง:} รันเกมในหน้าต่างที่ปรับ​เปลี่ยนขนาดได้<size:3>{
}
<b>{เต็มจอ​ใน​โหมด​หน้าต่าง (แนะนำ):} รันเกม​เต็มจอ แต่​ก็​สามารถ​ให้​โปรแกรม​อื่น​แสดงผล​ซ้อนทับ​ได้​เมื่อ​กด Alt-Tab คุณ​ยัง​สามารถ​เลือก​ความละเอียด​ใน​การ​เรนเดอร์​ได้ แต่​ UI จะ​ถูก​เรนเดอร์​ด้วย​รายละเอียด​เดียว​กับ​เดสก์ท็อป​ของ​คุณ​เสมอ<size:3>{
}
<b>{เต็มจอ:} โหมด​เต็มจอ​โดยสมบูรณ์ ไม่​สามารถ​เรนเดอร์​หน้าต่าง​อื่นๆ เหนือ​ตัว​เกม​นี้​ได้ โหมด​นี้​อาจ​มีประสิทธิภาพ​มาก​กว่า​โหมด​หน้าต่างหาก​มี​ฮาร์ดแวร์​ที่

ความละเอียด<size:3>{
}<size:40>{
ความละเอียด​กำหนด​ความ​คม​ชัด​ของ​เกม<size:3>{
}
ความละเอียด​ส่ง​ผล​ต่อ​ประสิทธิภาพ​ของ​เกม​มาก​ที่สุด ลด​ความละเอียด​เพื่อ​เพิ่ม​ประสิทธิภาพ​ใน​การ​เรนเดอร์}

VSync<size:3>{
}<size:40>{
<b>{ปิด:} เฟรม​เรต​สูง​ที่สุด​เท่า​ที่​เป็น​ไป​ได้ อาจ​พบ Frame Tearing ได้<size:3>{
}
"<b>{ปรับอัตโนมัติ (แนะนำ):} จำกัดเฟรมเรตให้เท่ากับอัตราการรีเฟรชของจอ อาจพบ Frame Tearing
ได้หากเฟรมเรตลดลงต่ำกว่าอัตราการรีเฟรชของจอ<size:3>{
}
<b>{ล็อก​เฟรม​เรต:} จำกัด​เฟรม​เรต​ให้​เท่ากับ​อัตรา​การ​รีเฟรช​ของ​จอ ไม่​พบ Frame Tearing แต่​อาจ​เกิด Micro-Stutter ได้​หาก​เฟรม​เรต​ลด​ลง​ต่ำ​กว่า​อัตราการ​รีเฟรช​ของ​จอ}

Antialiasing<size:3>{
}<size:40>{
Antialiasing ลด​ขอบ​ขรุขระ​ของ​รูปร่าง​ต่างๆ แต่​ก็​ใช้​ทรัพยากร​สูง​ตาม​ความ​ละเอียด​ของ​คุณ}

แสงเงา<size:3>{
}<size:40>{
การ​ตั้งค่า​นี้​ควบคุม​การ​เปิด​ใช้​แสงเงา​ชนิด​ต่างๆ<size:3>{
}
<b>{เงา:} เปิดใช้เงาสำหรับแสงทุกชนิด เงาจากดวงอาทิตย์ไม่ใช้ทรัพยากรมากนัก แต่จะใช้ทรัพยากร
เพิ่มขึ้นเล็กน้อยตามจำนวนของมอนสเตอร์ในจอ เงาอื่นๆ ใช้ทรัพยากรตายตัวเสมอไม่ว่าจะมีเหตุการณ์
ปรากฏบนหน้าจอเท่าไร คุณสามารถตั้งค่าการใช้ทรัพยากรของเงาทั้งสองชนิดนี้ตาม
ตัวเลือกทางด้านล่าง<size:3>{
}
<b>{เงา + Global Illumination (ค่าเริ่มต้น):} ถ้าเปิดใช้งาน GI วัตถุที่สว่างทุกชนิดจะเปล่งแสง
คุณจะสังเกตเห็นได้เป็นพิเศษจาก

คุณภาพเงา + GI<size:3>{
}<size:40>{
การ​ตั้งค่า​นี้​ควบคุม​คุณภาพ​และ​การ​ใช้​ทรัพยากร​สำหรับ​เงา​ที่​ไม่​ได้​มา​จาก​ดวงอาทิตย์​และ Global Illumination การ​ตั้ง​ค่า​นี้​ใช้​ทรัพยากร​อย่าง​ตายตัว มัน​จึง​ไม่​ทำให้​เกม​ช้า​ลง​แม้​จะ​มี​เหตุการณ์ปรากฏ​บน​หน้าจอ​มากขึ้น<size:3>{
}
<b>{ต่ำ (ค่าเริ่มต้น):} การ​ตั้งค่า​นี้​ทำให้​เงา​และ GI ใช้ทรัพยากร​ต่ำ​มาก<size:3>{
}
<b>{ปานกลาง (แนะนำ):} เงา​ดูดี และ​ใช้​ทรัพยากร​ไม่​มาก​นัก<size:3>{
}
<b>{สูงสุด:} การตั้งค่า​นี้​สำหรับ​การ์ดจอ​ระดับ​สูง หาก​เปิด​ใช้​งาน G

คุณภาพ​เงา​จาก​ดวงอาทิตย์<size:3>{
}<size:40>{
การ​ตั้ง​ค่า​นี้​ส่ง​ผล​ต่อ​แสง​เงา​ที่​มี​ทิศทาง​และ​แสง​เงา​ชนิด​จุด ส่วน​ใหญ่​การ​ตั้ง​ค่า​นี้​ใช้​ทรัพยากร​อย่าง​ตายตัว มัน​จะ​ใช้​ทรัพยากร​เพิ่ม​ขึ้น​เล็ก​น้อย​เมื่อ​มี​เหตุการณ์​ปรากฏ​บน​หน้า​จอ​เพิ่ม​ขึ้น}

การ​กระจาย​แสง<size:3>{
}<size:40>{
การ​ตั้งค่า​นี้​จะ​ควบคุม​ปริมาณ​การ​กระจาย​แสง​ที่​คุณ​เห็น​จาก​เอฟเฟค​ที่​สว่าง การ​ตั้งค่า​นี้​มี​เพื่อ​ความ​สวยงาม​เท่านั้น​และ​ไม่​ส่ง​ผล​ต่อ​ประสิทธิภาพ​ของ​เกม}

เอฟเฟคเนื้อหาย้อนเวลา/คำขาด<size:3>{
}<size:40>{
การ​ตั้งค่า​นี้​ควบคุม​ปริมาณ​เอฟเฟค​ภาพ​เบลอ​ที่​ใช้​ระหว่าง​การ​เผชิญหน้า ย้อนเวลา, คำขาด, สมุดรวมสัตว์}

ระดับ​รายละเอียด​น้ำ<size:3>{
}<size:40>{
ตั้ง​ค่า​ไว้​ที่ ต่ำ ​จะ​ลด​ความละเอียด​ของ​น้ำ​ มัน​จะ​เห็น​ชัด​ก็​ต่อ​เมื่อ​มี​น้ำ​จำนวนมาก​ปรากฏ​บน​หน้าจอ}

คุณภาพ​ภาพพื้นผิว<size:3>{
}<size:40>{
ตั้งค่า​ไว้​ที่ ปานกลาง เพื่อ​ลด​คุณภาพ​ของ​ภาพ​พื้นผิว แต่​ใช้​หน่วย​ความจำ​การ์ดจอ​น้อย​ลง การ​ตั้ง​ไว้​ที่ สูง นั้น​แทบ​ไม่​ส่ง​ผล​ต่อ​การ​ใช้​ทรัพยากร เว้น​แต่​การ์ดจอ​ของ​คุณ​มี​หน่วย​ความ​จำ​ต่ำ ใน​กรณี​นี้​ตั้ง​ไว้​ที่​ปานกลาง​จะ​เพิ่ม​ประสิทธิภาพ​เป็น​อย่าง​มาก ซึ่ง​เหมาะ​กับ​การ์ด​จอ​รุ่น​เก่า​ที่​มี​หน่วย​ความ​จำ​น้อย​เท่านั้น หาก​การ​เปลี่ยน​ค่า​นี้​ไม่​ส่ง​ผล​ต่อ​ความเร็ว เรา​แนะนำ​ให้​ตั้ง​ไว้​ที่ สูง}

การฟิลเตอร์ภาพพื้นผิว<size:3>{
}<size:40>{
เปลี่ยน​คุณภาพ​ของ​ภาพ​พื้น​ผิว​ที่​อยู่​ใน​มุมชัน​มากๆ ต่อ​กล้อง}

ปรับความละเอียดโดยอัตโนมัติ<size:3>{
}<size:40>{
การตั้งค่านี้จะรักษาเฟรมเรตเป้าหมายตามที่คุณตั้งไว้ด้วยการปรับลดสเกลความละเอียดใน
การเรนเดอร์เมื่อมีเหตุการณ์มากมายเกิดขึ้นบนจอ เราขอแนะนำให้เปิดใช้การตั้งค่านี้เป็นอย่าง
ยิ่ง}

เวอร์ชัน DirectX<size:3>{
}<size:40>{
เรา​แนะนำ​ให้​ตั้ง​ไว้​ที่ อัตโนมัติ เพื่อ​ให้​ตัว​เกม​เลือก​เวอร์ชัน​ล่าสุด​ของ DirectX ที่​เครื่อง​คุณ​สามารถ​ใช้​งาน​ได้ ทว่า​อาจ​มี​เหตุผล​ด้าน​การ​รองรับ​บาง​ประการ​ใน​การ​เลือก​ใช้​ค่า​อื่น​ที่​ไม่ใช่​ค่า​เริ่มต้น<size:3>{
}
<b>{DirectX 11 (แนะนำ):} เวอร์ชัน​นี้​เร็ว​ที่สุด​และ​ลด​อาการ​กระตุก และ​ยัง​เปิด​ใช้​งาน​ฟีเจอร์​กราฟิก​ต่างๆ ที่​มีใน DX11 เท่านั้น ทั้งนี้ DX11 ใช้​งาน​ใน​โหมด 64bit อีก​ด้วย เพราะ​ฉะนั้น​คุณ​ต้อง​ใช้ OS ที่​รองรับ 64bit เท่านั้น<size:3>

Engine Multithreading<size:3>{
}<size:40>{
การ​ตั้ง​ค่า​นี้​ทำให้​ตัว​เกม​สามารถ​ใช้ CPU ของ​คุณ​ได้​มากกว่า​หนึ่ง​คอร์ เรา​แนะนำ​ให้​เปิด​ไว้​เป็น​อย่าง​ยิ่ง}

จำนวนแสง<size:3>{
}<size:40>{
การ​ตั้ง​ค่า​นี้​ควบคุม​จำนวน​แสง​ใน​ฉาก<size:3>{
}
<b>{ต่ำ:} เรนเดอร์​เฉพาะ​แสง​จาก​สิ่งแวดล้อม​เท่านั้น<size:3>{
}
<b>{ปานกลาง:} เพิ่ม​แสง​จาก​เอฟเฟค​ไดนามิก อย่างเช่น สกิล<size:3>{
}
<b>{สูง (ค่าเริ่มต้น):} เพิ่ม​แสง​ให้​กับ​เอฟเฟค​ที่​สามารถ​ปรากฏ​บน​หน้าจอ​ได้​หลายครั้ง อย่าง​เช่น โพรเจกไทล์}

